// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom"; // ✅ Added Navigate
import { useAuth0 } from "@auth0/auth0-react";
import Header from "./components/Header";
import About from "./components/About";
import BlockchainIntegration from "./components/BlockchainIntegration";
import CompatibilityCheck from "./components/CompatibilityCheck";
import Contact from "./components/Contact";
import Home from "./components/Home";
import FormPage from "./components/FormPage";
import ResultPage from "./components/ResultPage";
import Login from "./components/Login";
import Signup from "./components/Signup";
import "./App.css";

function ProtectedRoute({ element }) {
  const { isAuthenticated, isLoading } = useAuth0();

  if (isLoading) return <h2>Loading...</h2>;
  return isAuthenticated ? element : <Navigate to="/login" replace />;
}

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<CompatibilityCheck />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/about" element={<About />} />
        <Route path="/about" element={<BlockchainIntegration />} />
        <Route path="/about" element={<Lo />} />
        {/* Protect these pages */}
        <Route path="/form" element={<ProtectedRoute element={<FormPage />} />} />
        <Route path="/result" element={<ProtectedRoute element={<ResultPage />} />} />
      </Routes>
    </Router>
  );
}

export default App;
